import React from "react";
import "./VideoList.css"

const VideoList = (props) => {
    if (props.Response.data){
    const imgs = props.Response.data.items
    const img = imgs.map((item) => {
        return <img className="col-10 offset-1 mt-1" key={item.id.videoId} src={item.snippet.thumbnails.high.url} style={{cursor: "pointer"}}/>
    })

    return (
        <div> {img} </div>
    )
}
}

export default VideoList;
